<template>
  <div class="routerview">
    <h3>蚂蚁税服-A端业务梳理</h3>
    <p class="h4">立项目的</p>
      <h5>蚂蚁税服当前现状:</h5>
      1.意向客户没有一个统一管理分配销售人员的管理系统.无法针对不同的客户进行实时记录.标记客户状态等信息;
      <br>
      2.成单客户以电话微信等形式沟通报税人员,消息沟通成本高,失误率高.无法实时记录订单每个环节,很容易造成订单环节的失误;
      <br>
      <br>
      <h5>A端系统目的:</h5>
      制作设计A端管理系统,主要为了更加方便直观的<br><br>
      1.销售业务:管理意向客户;<br>
      2.交付业务:管理成交客户报税,查看历史清单等功能;<br>
      
    <br><br>
    <p class="h4">系统主要功能及实现</p>
      <h5>面向销售人员</h5>
        一:C端注册用户<br>
        (1)查询注册用户姓名/电话/备注;<br>
        (2)对应销售标记:例如:小张|小李|小刘;;<br>
        (3)是否电话联系标记;<br>
        (4)意向等级划分1-5<br>
        (5)付费后添加标记,在开票业务系统展示<br>
        二:报名用户<br>
        (1)查询用户姓名/电话/可以做备注<br>
        (2)A端操作可以将客户踢到注册用户中<br>

      <h5>面向报税人员</h5>
        (1)实现付费用户在线申请发票的展示;<br>
        (2)交付业务的流程;<br>
